CREATE TABLE `taxonomy` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `TA_ID` double DEFAULT NULL,
  `ID_ACCEPTED` double DEFAULT NULL,
  `NomenclaturalCode` varchar(255) DEFAULT NULL,
  `Kingdom` varchar(255) DEFAULT NULL,
  `KingdomSource` varchar(255) DEFAULT NULL,
  `Phylum` varchar(255) DEFAULT NULL,
  `PhylumSource` varchar(255) DEFAULT NULL,
  `SubPhylum` varchar(255) DEFAULT NULL,
  `SubPhylumSource` varchar(255) DEFAULT NULL,
  `Class` varchar(255) DEFAULT NULL,
  `ClassSource` varchar(255) DEFAULT NULL,
  `Subclass` varchar(255) DEFAULT NULL,
  `SubclassSource` varchar(255) DEFAULT NULL,
  `SuperOrder` varchar(255) DEFAULT NULL,
  `SuperOrderSource` varchar(255) DEFAULT NULL,
  `Order` varchar(255) DEFAULT NULL,
  `OrderSource` varchar(255) DEFAULT NULL,
  `Suborder` varchar(255) DEFAULT NULL,
  `SuborderSource` varchar(255) DEFAULT NULL,
  `InfraOrder` varchar(255) DEFAULT NULL,
  `InfraOrderSource` varchar(255) DEFAULT NULL,
  `SuperFamily` varchar(255) DEFAULT NULL,
  `SuperfamilySource` varchar(255) DEFAULT NULL,
  `Family` varchar(255) DEFAULT NULL,
  `FamilySource` varchar(255) DEFAULT NULL,
  `Subfamily` varchar(255) DEFAULT NULL,
  `SubfamilySource` varchar(255) DEFAULT NULL,
  `Genus` varchar(255) DEFAULT NULL,
  `GenusSource` varchar(255) DEFAULT NULL,
  `Subgenus` varchar(255) DEFAULT NULL,
  `SubgenusSource` varchar(255) DEFAULT NULL,
  `SpecificEpithet` varchar(255) DEFAULT NULL,
  `SpecificEpithetSource` varchar(255) DEFAULT NULL,
  `InfraspecificRank` varchar(255) DEFAULT NULL,
  `InfraspecificEpithet` varchar(255) DEFAULT NULL,
  `InfraspecificEpithetSource` varchar(255) DEFAULT NULL,
  `AcceptedSpecies` varchar(255) DEFAULT NULL,
  `VerbatimSpecies` varchar(255) DEFAULT NULL,
  `VerbatimSpeciesSource` varchar(255) DEFAULT NULL,
  `IsMarine` double DEFAULT NULL,
  `IsTerrestrial` double DEFAULT NULL,
  `Comments` varchar(255) DEFAULT NULL,
  `ReviewedBy` varchar(255) DEFAULT NULL,
  `ReviewDate` varchar(255) DEFAULT NULL,
  `Notes` varchar(255) DEFAULT NULL,
  `Status` varchar(255) DEFAULT NULL,
  `ChangedBy` varchar(255) DEFAULT NULL,
  `ChangeDate` datetime DEFAULT NULL,
  `Validation` varchar(255) DEFAULT NULL,
  `ValidatedBy` varchar(255) DEFAULT NULL,
  `ValidationDate` datetime DEFAULT NULL,
  `Stability` double DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `king_idx` (`Kingdom`),
  KEY `phy_idx` (`Phylum`) USING BTREE
) ENGINE=InnoDB  DEFAULT CHARSET=latin1;


